import BillingImg from '../../images/GenerateBill.png';
const ProductCatalog = () => {
    return (
        <div>
            <div>
                <img src={BillingImg} alt="billingimage"></img>
            </div>
            <div>
                <img src={BillingImg} alt="billingimage"></img>
            </div>
        </div>
    );
}   
export default ProductCatalog;
